import React from 'react'
import useHome from '../data/useHome'
import HTMLReactParser from 'html-react-parser';


const Home = () => {
    const home = useHome();
    return (
        home.map(item => (
            <div key={item}>
                <h1>{item.title}</h1>
                <p>{item.content}</p>
            </div>
        ))
    )
}

export default Home
